import Link from 'next/link';
import Navstyles from './styles/NavStyles';

const Nav = () => (
    <Navstyles>
        <Link href="/">
            <a>Home</a>
        </Link>

        <Link href="/sell">
            <a>Sell</a>
        </Link>

        <Link href="/">
            <a>Home</a>
        </Link>

    </Navstyles>
)

export default Nav;
